def height(pos):
    total = -pos[1] * 369.565 - 334.913
    f = int(total // 12)
    i = total % 12
    return f, i

def packData(list):
    data = []
    for point in list:
        data.append(point[0])
        data.append(point[1])
        data.append(point[2])
    return data

